INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130011, "2030/01/01 14:59:59", 1, -416.5, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "ヤマト", 2, 0.0, 2.1, 100, 3001100, 3001, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130011, "2030/01/01 14:59:59", 4, -416.5, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "ヤマト", 2, 0.0, 5.68, 101, 3001101, 3001, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130011, "2030/01/01 14:59:59", 1, -416.5, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "ヤマト", 1, 0.0, 0.0, 102, 3001102, 3001, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 1, -416.5, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "フブキ", 1, 0.0, 0.0, 100, 3002100, 3002, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 1, -416.5, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "フブキ", 1, 0.0, 0.0, 101, 3002101, 3002, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 5, -416.5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "フブキ", 2, 0.0, 8.53, 102, 3002102, 3002, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 7, -416.5, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "フブキ", 1, 0.0, 5.67, 103, 3002103, 3002, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 1, -416.5, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "フブキ", 1, 0.0, 0.0, 104, 3002104, 3002, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 3, -416.5, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "フブキ", 3, 0.0, 0.0, 300, 3002300, 3004, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 7, -416.5, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "フブキ", 7, 0.0, 0.0, 301, 3002400, 3005, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 2, -416.5, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "フブキ", 1, 0.0, 4.4, 200, 3003200, 3003, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 7, -416.5, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "フブキ", 7, 0.0, 0.0, 201, 3003201, 3003, "2024/10/31 12:00:00");
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (130211, "2030/01/01 14:59:59", 1, -416.5, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "フブキ", 2, 0.0, 5.6, 202, 3003202, 3003, "2024/10/31 12:00:00");
